import React, { Component } from 'react';


class Frist extends Component {
    constructor(props) {
        super(props)

        this.state = {
            login: false,
            login: true
        }
    }

    render() {
        let massage
        if (this.state.login) {
            massage = <div>navid</div>
        } else {
            massage = <div>nabizada</div>
        }
        return <div>{massage}
        <iframe width="794" height="440" src="https://www.youtube.com/embed/7o5FPaVA9m0?list=PLC3y8-rFHvwgg3vaYJgHGnModB54rxOk3" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" fullscreen></iframe></div>
    }
}

export default Frist;
